<!DOCTYPE html>
<html lang="en">
<head>
  <meta charset="UTF-8">
  <meta content="#ffffff" name="theme-color">
  <meta content="#ffffff" name="msapplication-TileColor">
  <meta content="ie=edge" http-equiv="X-UA-Compatible">
  <meta content="width=device-width,initial-scale=1" name="viewport">
  <meta content="Personal contacts page" name="description"/>
  <link href="asset-manifest.json" rel="manifest">
  <link rel="icon" type="image/png" href="assets/img/favicon.png">
  <link crossorigin href="https://fonts.gstatic.com/" rel="preconnect">

  <meta content="style-src 'self' 'unsafe-inline' 'unsafe-eval' https://fonts.googleapis.com;"

  <meta content="script-src 'self' 'unsafe-inline' 'unsafe-eval' http://www.google.com https://fonts.googleapis.com;"

  <title><%= htmlWebpackPlugin.options.title %></title>
</head>

<div class="header">
</div>
